const bool dumpUnzip = false;
const bool dumpBinwalk = false;

void unzip(String path) {
  if (dumpUnzip) {
    var unzip = Process.runSync("unzip", ["-t", path]);
    print(unzip.stdout);
    print(unzip.stderr);
  }
}

void binwalk(String path) {
  if (dumpBinwalk) {
    var binwalk = Process.runSync("binwalk", [path]);
    print(binwalk.stdout);
    print(binwalk.stderr);
  }
}

Archive readZip(String path, {bool verify: true}) {
  binwalk(path);
  var data = new File(path).readAsBytesSync();
  return new ZipDecoder().decodeBytes(data, verify: verify);
}

List<int> encodeZip(Archive archive, {int level: Deflate.BEST_SPEED}) {
  return new ZipEncoder().encode(archive, level: level);
}

void writeZip(String path, Archive archive, {bool clone: true, int level: Deflate.BEST_SPEED}) {
  if (clone) {
    archive = cloneArchive(archive);
  }
  var bytes = encodeZip(archive, level: level);
  new File(path)
    ..createSync(recursive: true)
    ..writeAsBytesSync(bytes);
  unzip(path);
  binwalk(path);
}

Archive cloneArchive(Archive archive) {
  var clone = new Archive();
  archive.files.forEach((file) {
    if (file.isFile) {
      var content = (file.content as Uint8List).toList();
      var copy = new ArchiveFile(file.name, content.length, content)..compress = file.compress;
      clone.addFile(copy);
    }
  });
  return clone;
}

int countFiles(Archive archive) => archive.files.where((file) => file.isFile).length;

String toString(List<int> bytes) {
  return new String.fromCharCodes(bytes);
}

List<int> fromString(String string) {
  return string.codeUnits;
}

String toBase64(List<int> input) {
  return new Base64Encoder().convert(input);
}

List<int> fromBase64(String input) {
  return new Base64Decoder().convert(input);
}

const String allHelloPath = "Hello.txt";
const String allSmilePath = "images/smile.gif";
const String allHello = "Hello World\n";
const String allSmile = "R0lGODdhBQAFAIACAAAAAP/eACwAAAAABQAFAAACCIwPkWerClIBADs=";
Archive expectFileAll(String path, Matcher helloMatcher, Matcher smileMatcher) {
  var archive = readZip(path);
  var hello = archive.findFile(allHelloPath);
  var smile = archive.findFile(allSmilePath);

  expect(countFiles(archive), 2);
  expect(
    toString(hello.content),
    allHello,
    reason: allHelloPath,
  );
  expect(hello.compress, helloMatcher, reason: allHelloPath);

  expect(
    toBase64(smile.content),
    allSmile,
    reason: allSmilePath,
  );
  expect(smile.compress, smileMatcher, reason: allSmilePath);

  return archive;
}

