    test('all.zip', () {
      var zip = 'all.zip';
      var archive = expectFileAll('test/ref/zip/$zip', isFalse, isFalse);
      writeZip('test/out/zip/$zip', archive);
      expectFileAll('test/out/zip/$zip', isFalse, isFalse);
    });

    test('all-stream.zip', () {
      var zip = 'all-stream.zip';
      var archive = expectFileAll('test/ref/zip/$zip', isFalse, isFalse);
      writeZip('test/out/zip/$zip', archive);
      expectFileAll('test/out/zip/$zip', isFalse, isFalse);
    });

    test('all.7zip.zip', () {
